import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { useNavigate } from 'react-router-dom';
import ModelViewer from './ModelViewer';
import ARViewer from './ARViewer';
import QRCode from 'qrcode.react';

const domeOptions = [
  {
    id: 'dome1',
    name: 'Geodome Nordic',
    description: 'Design escandinavo com painéis de madeira e vidro, perfeito para integração com a natureza',
    size: '6m x 6m',
    modelFile: 'models/ImageToStl.com_geodome_d15m_4v_woodframe',  // Base name without extension
    modelFileWeb: '/models/ImageToStl.com_geodome_d15m_4v_woodframe.glb',
    image: '/images/domes/snowdon-dome.jpg',
    features: [
      'Painéis de madeira natural',
      'Janelas panorâmicas',
      'Porta frontal ampla',
      'Painel solar integrado',
      'Deck de entrada',
      'Sistema de ventilação natural'
    ],
    specifications: {
      'Área': '28m²',
      'Altura': '3.5m',
      'Material': 'Madeira e Vidro',
      'Tempo de Montagem': '2-3 dias',
      'Garantia': '5 anos',
      'Capacidade': '4-6 pessoas'
    }
  }
];

function DomeSection() {
  const [show3DModel, setShow3DModel] = useState(false);
  const navigate = useNavigate();
  const [showShareModal, setShowShareModal] = useState(false);
  const [shareUrl, setShareUrl] = useState('');
  const selectedDome = domeOptions[0];

  const handleARClick = () => {
    navigate(`/ar-view/${selectedDome.id}?model=${encodeURIComponent(selectedDome.modelFile)}`);
  };

  const handle3DClick = () => {
    setShow3DModel(!show3DModel);
  };

  return (
    <div className="min-h-screen bg-gray-50 py-12">
      <div className="container mx-auto px-4">
        <div className="text-center mb-12">
          <h2 className="text-4xl font-bold text-gray-900 mb-4">
            Nossos Modelos
          </h2>
          <p className="text-xl text-gray-600">
            Explore nossos modelos em 3D e Realidade Aumentada
          </p>
        </div>

        <div className="max-w-6xl mx-auto">
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            className="bg-white rounded-xl shadow-lg overflow-hidden"
          >
            <div className="grid grid-cols-1 md:grid-cols-2 gap-8 p-8">
              <div className="relative aspect-square bg-gray-100 rounded-lg overflow-hidden">
                {show3DModel ? (
                  <ModelViewer modelUrl={selectedDome.modelFileWeb} />
                ) : (
                  <img
                    src={selectedDome.image}
                    alt={selectedDome.name}
                    className="w-full h-full object-cover cursor-pointer"
                    onClick={handle3DClick}
                  />
                )}
              </div>

              <div>
                <h3 className="text-2xl font-bold text-gray-900 mb-4">
                  {selectedDome.name}
                </h3>
                <p className="text-gray-600 mb-6">
                  {selectedDome.description}
                </p>

                <div className="space-y-6">
                  <div>
                    <h4 className="text-lg font-semibold text-gray-900 mb-3">
                      Características
                    </h4>
                    <ul className="grid grid-cols-2 gap-2">
                      {selectedDome.features.map((feature, index) => (
                        <li key={index} className="flex items-center text-gray-600">
                          <span className="mr-2">•</span>
                          {feature}
                        </li>
                      ))}
                    </ul>
                  </div>

                  <div>
                    <h4 className="text-lg font-semibold text-gray-900 mb-3">
                      Especificações
                    </h4>
                    <dl className="grid grid-cols-2 gap-2">
                      {Object.entries(selectedDome.specifications).map(([key, value]) => (
                        <div key={key}>
                          <dt className="text-gray-500">{key}</dt>
                          <dd className="text-gray-900 font-medium">{value}</dd>
                        </div>
                      ))}
                    </dl>
                  </div>

                  <div className="flex gap-4">
                    <button
                      onClick={handle3DClick}
                      className="flex-1 bg-gray-800 hover:bg-gray-900 text-white py-3 px-4 rounded-lg text-center font-medium transition-colors"
                    >
                      {show3DModel ? 'Ver Foto' : 'Ver em 3D'}
                    </button>
                    <button
                      onClick={handleARClick}
                      className="flex-1 bg-emerald-600 hover:bg-emerald-700 text-white py-3 px-4 rounded-lg text-center font-medium transition-colors"
                    >
                      Ver em AR
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </motion.div>
        </div>
      </div>

      {/* Share Modal */}
      {showShareModal && shareUrl && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white p-6 rounded-lg max-w-sm w-full mx-4">
            <h3 className="text-lg font-semibold mb-4">Compartilhar Visualização AR</h3>
            <div className="flex justify-center mb-4">
              <QRCode value={shareUrl} size={200} />
            </div>
            <p className="text-sm text-gray-600 mb-4 text-center">
              Escaneie este QR code ou compartilhe o link para ver o objeto AR na mesma posição
            </p>
            <div className="space-y-2">
              <button
                onClick={() => {
                  navigator.clipboard.writeText(shareUrl);
                  alert('Link copiado!');
                }}
                className="w-full bg-emerald-600 hover:bg-emerald-700 text-white py-2 px-4 rounded-lg text-center font-medium transition-colors"
              >
                Copiar Link
              </button>
              <button
                onClick={() => setShowShareModal(false)}
                className="w-full bg-gray-100 hover:bg-gray-200 text-gray-800 py-2 px-4 rounded-lg text-center font-medium transition-colors"
              >
                Fechar
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default DomeSection;
